import React from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import axios from 'axios';
import './RegisterForm.css';

const RegisterSchema = Yup.object().shape({
    email: Yup.string().email('유효하지 않은 이메일 형식입니다.').required('이메일을 입력하세요'),
    name: Yup.string().required('이름을 입력하세요'),
    age: Yup.number().min(1, '유효한 나이를 입력하세요').required('나이를 입력하세요'),
    gender: Yup.string().oneOf(['남성', '여성', '기타'], '유효한 성별을 선택하세요').required('성별을 선택하세요'),
    password: Yup.string()
        .min(8, '비밀번호는 8자리 이상이어야 합니다.')
        .matches(/^(?=.*[a-zA-Z])(?=.*\d)[a-zA-Z\d]{8,}$/, '비밀번호는 영문자와 숫자를 포함해야 합니다.')
        .required('비밀번호를 입력하세요'),
    confirmPassword: Yup.string()
        .oneOf([Yup.ref('password'), null], '패스워드가 일치하지 않습니다.')
        .required('비밀번호를 입력하세요'),
});

const RegisterForm = () => {
    return (
        <div className="register-form-container">
            <h1>회원가입</h1>
            <Formik
                initialValues={{ email: '', name: '', age: '', gender: '', password: '', confirmPassword: '' }}
                validationSchema={RegisterSchema}
                onSubmit={(values, { setSubmitting }) => {
                    const { confirmPassword, ...data } = values;
                    axios.post('http://localhost:8080/api/auth/register', data)
                        .then((response) => {
                            console.log(response.data);
                            setSubmitting(false);
                            alert('회원가입이 완료되었습니다.');
                        })
                        .catch((error) => {
                            console.error(error);
                            setSubmitting(false);
                            alert('회원가입에 실패했습니다.');
                        });
                }}
            >
                {({ isSubmitting, values, handleChange }) => (
                    <Form>
                        <div className="form-field">
                            <Field type="email" name="email" placeholder="이메일" onChange={handleChange} />
                            <ErrorMessage name="email" component="div" className="error-message" />
                        </div>
                        <div className="form-field">
                            <Field type="text" name="name" placeholder="이름" />
                            <ErrorMessage name="name" component="div" className="error-message" />
                        </div>
                        <div className="form-field">
                            <Field type="number" name="age" placeholder="나이" />
                            <ErrorMessage name="age" component="div" className="error-message" />
                        </div>
                        <div className="form-field">
                            <Field as="select" name="gender">
                                <option value="">성별 선택</option>
                                <option value="남성">남성</option>
                                <option value="여성">여성</option>
                                <option value="기타">기타</option>
                            </Field>
                            <ErrorMessage name="gender" component="div" className="error-message" />
                        </div>
                        <div className="form-field">
                            <Field type="password" name="password" placeholder="비밀번호" />
                            <ErrorMessage name="password" component="div" className="error-message" />
                        </div>
                        <div className="form-field">
                            <Field type="password" name="confirmPassword" placeholder="비밀번호 확인" />
                            <ErrorMessage name="confirmPassword" component="div" className="error-message" />
                        </div>
                        <button
                            type="submit"
                            disabled={isSubmitting || !values.email || !values.name || !values.age || !values.gender || !values.password || !values.confirmPassword}
                        >
                            Register
                        </button>
                    </Form>
                )}
            </Formik>
        </div>
    );
};

export default RegisterForm;
